function draw(w, h) {
    var format = pv.Format.number();
    var nodes = pv.dom(this.data).root("root").nodes();

    var vis = new pv.Panel()
        .width(w)
        .height(h)
        .fillStyle("gray")
        .event("mousedown", pv.Behavior.pan())
        .event("mousewheel", pv.Behavior.zoom());

    var partition = vis.add(pv.Layout.Partition.Fill)
        .nodes(nodes)
        .size(function(d){return d.nodeValue})
        .order("descending")
        .orient("radial");

    partition.node.add(pv.Wedge)
        .fillStyle(pv.Colors.category19().by(function(d){
            return d.parentNode && d.parentNode.nodeName}))
        .strokeStyle("#fff")
        .lineWidth(.5);

    partition.label.add(pv.Label)
        .visible(function(d) { return  d.angle * d.outerRadius >= 6 });

    return vis;
}

