function updateVis() {
    sortIntoTree = function(path, subtree) {
        if (path.length == 0) return;
        var name = path.shift();
        if (path.length == 0) {
            subtree[name] = 1;
            return
        }    
        if (!subtree[name] || subtree[name] == 1) {
            subtree[name] = {}
        };
        return sortIntoTree(path, subtree[name])

    }
    buildTree = function(rootURL) {
        var tree = {}
        var webR = new WebResource(rootURL).getSubElements(10)
        var all = webR.subCollections.concat(webR.subDocuments);
        all.forEach(function(ea) {
            var path = ea.getURL().relativePathFrom(rootURL)
                .split("/").select(function(ea){return ea}).collect(function(ea) {
                    return ea.replace(/[^A-Za-z0-1]/g, "_")
                })
            sortIntoTree(path, tree)
        })
        alert("found " + all.length + " pages")
        return tree
    }
    var data = buildTree(new URL(this.get('urlText').textString))   

    this.get('ProtoVisGraph').setDataAndRender(data)
}
